1368b7','','','2019-11-11 13:11:38','2019-11-11 13:11:38','',39,'https://staginggoalore.wpengine.com/?post_type=acf-field&p=41',1,'acf-field','',0),(45,1,'2019-11-19 10:44:09','2019-11-19 10:44:09','<!-- wp:paragraph {\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">We do good deeds everyday. We do this primarily to help family, friends, coworkers, and the community. Good deeds can be in many shapes - service,  advice, monetary, or encouragement. Irrespective of the shape or size, good deeds create a positive impact. Often, a small and timely help in the shape of an advice or encouragement has a big impact on someone’s life than a monetary help. Most do not expect anything in return for the good deed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Goalore, we want to create a platform for members to help each other  achieve their individual or community goals. The help can be a timely point of view, a solution to overcome a challenge; or perhaps you are in a similar journey and can provide wisdom to avoid pitfalls; or you are offering encouragement. These good deeds could motivate and inspire individuals and the community at large.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Within Goalore, we track these good deeds as “Good Deed Points”. The main reason we want to track “Good Deed Points” is to help members. If you are helping others, we want others to help you more. When members connected to you or general members are searching for goals, members with highest “Good Deed Points” are ranked higher – making it easier for members to follow your goal and help you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">You can earn “Good Deed Points” in the following ways.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>When you join Goalore – we grant you some points as appreciation for your action to join the community.</li><li>Point of Views (POV) – Goal owners can rate your point of views.</li><li>Number of followers for your completed goals. This recognition is for inspiring other members within the Goalore community to follow and support your goal through completion.</li><li>Referring your friends and family to join Goalore to grow/support the community.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">We are constantly looking for other ways to use “Good Deed Points”. &nbsp;We hope you will find more opportunities to do good deeds at Goalore. Please join Goalore and let’s help each other to achieve our goals!</p>\n<!-- /wp:paragraph -->','Good Deeds','','publish','open','open','','good-deeds','','','2020-01-30 02:11:58','2020-01-30 02:11:58','',0,'https://staginggoalore.wpengine.com/?p=45',0,'post','',0),(46,1,'2019-11-12 10:43:53','2019-11-12 10:43:53','','Good_Deeds_v2','','inherit','open','closed','','good_deeds_v2','','','2019-11-12 10:43:53','2019-11-12 10:43:53','',45,'https://staginggoalore.wpengine.com/wp-content/uploads/2019/11/Good_Deeds_v2.png',0,'attachment','image/png',0),(47,1,'2019-11-12 10:43:59','2019-11-12 10:43:59','<!-- wp:paragraph -->\n<p>Most do some good deeds regularly – out of love, conscience, affiliation, religion, or other factors. We do this primarily to help others and the community. Good deeds can be in many shapes - money, services, time, advice, or encouragement. The important attribute of a good deed is the positive impact it can make. Often, a small and timely help in the shape of an advice or encouragement has a big impact on someone’s life than a monetary help. Most do not expect anything in return for the good deed other than the knowledge their good deed made a difference in someone’s life – big or small.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Goalore, we want to create a forum for members to help other members achieve their individual or community goals. The help can be a timely point of view, that can be a solution to overcome a challenge; perhaps you are in a similar journey and can provide wisdom to avoid pitfalls; or you are offering encouragement. These good deeds could motivate and bring a big positive impact to individuals and the community at large.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, we track these good deeds as “Good Deed Points”. The main reason we want to track “Good Deed Points” is to help members. If you are helping others, we want others to help you more. When members connected to you or general members are searching for goals, members with highest “Good Deed Points” are ranked higher – making it easier for members to follow your goal and help you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You can earn “Good Deed Points” in the following ways.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>When you join Goalore – we grant you some points as appreciation for your action to join the community.</li><li>Point of Views (POV) – Goal owners can rate your point of views.</li><li>Number of followers for your completed goals. This recognition is for inspiring other members within the Goalore community to follow and support your goal through completion.</li><li>Referring your friends and family to join Goalore to grow/support the community.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>We are constantly looking for other ways to use “Good Deed Points”. &nbsp;We hope you will find more opportunities to do good deeds at Goalore. Please join Goalore and let’s help each other to achieve our goals!</p>\n<!-- /wp:paragraph -->','Good Deeds','','inherit','closed','closed','','45-revision-v1','','','2019-11-12 10:43:59','2019-11-12 10:43:59','',45,'https://staginggoalore.wpengine.com/45-revision-v1/',0,'revision','',0),(48,1,'2019-11-12 10:44:40','2019-11-12 10:44:40','<!-- wp:paragraph -->\n<p>Most do some good deeds regularly – out of love, conscience, affiliation, religion, or other factors. We do this primarily to help others and the community. Good deeds can be in many shapes - money, services, time, advice, or encouragement. The important attribute of a good deed is the positive impact it can make. Often, a small and timely help in the shape of an advice or encouragement has a big impact on someone’s life than a monetary help. Most do not expect anything in return for the good deed other than the knowledge their good deed made a difference in someone’s life – big or small.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Goalore, we want to create a forum for members to help other members achieve their individual or community goals. The help can be a timely point of view, that can be a solution to overcome a challenge; perhaps you are in a similar journey and can provide wisdom to avoid pitfalls; or you are offering encouragement. These good deeds could motivate and bring a big positive impact to individuals and the community at large.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, we track these good deeds as “Good Deed Points”. The main reason we want to track “Good Deed Points” is to help members. If you are helping others, we want others to help you more. When members connected to you or general members are searching for goals, members with highest “Good Deed Points” are ranked higher – making it easier for members to follow your goal and help you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You can earn “Good Deed Points” in the following ways.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>When you join Goalore – we grant you some points as appreciation for your action to join the community.</li><li>Point of Views (POV) – Goal owners can rate your point of views.</li><li>Number of followers for your completed goals. This recognition is for inspiring other members within the Goalore community to follow and support your goal through completion.</li><li>Referring your friends and family to join Goalore to grow/support the community.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>We are constantly looking for other ways to use “Good Deed Points”. &nbsp;We hope you will find more opportunities to do good deeds at Goalore. Please join Goalore and let’s help each other to achieve our goals!</p>\n<!-- /wp:paragraph -->','Good Deeds','Most do some good deeds regularly – out of love, conscience, affiliation, religion, or other factors. We do this primarily to help others and the community. Good deeds can be in many shapes - money, services, time, advice, or encouragement. The important attribute of a good deed is the positive impact it can make. Often, a small and timely help in the shape of an advice or encouragement has a big impact on someone’s life than a monetary help. Most do not expect anything in return for the good deed other than the knowledge their good deed made a difference in someone’s life – big or small.','inherit','closed','closed','','45-revision-v1','','','2019-11-12 10:44:40','2019-11-12 10:44:40','',45,'https://staginggoalore.wpengine.com/45-revision-v1/',0,'revision','',0),(49,1,'2019-11-12 10:46:08','2019-11-12 10:46:08','<!-- wp:paragraph -->\n<p>Being with friends and family is a lot of fun. We have a lot of things in common, spend a significant part of our daily life, sharing aspirations and challenges with them. Friends and family roll up their sleeves to support us in our time of need and we would do the same for them. We cheer up remembering many fond memories of friendship and create new ones every day. Close friends also don’t hesitate to offer honest and transparent feedback/wisdom to help us – as they are uniquely positioned to do so without offending us.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Whether we acknowledge it or not, friends and family are constantly working with us on many of our goals. This could be planning for a get-together, the next family vacation, changing careers, losing weight, buying a house, or supporting a charity. Based on the goals, this collaboration could be short term with fewer friends/family or longer-term with many. If the goal is a big one, we may want to break it into smaller goals and with our friends/family owning some of the smaller goals. Together, one small goal completed by another, the larger goal is achieved. Working with other close friends/family make the journey pleasurable, providing a sense of purpose, achievement, satisfaction, and further strengthening our bond.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, the alliance feature enables this collaboration between two or more members to work together to achieve a large goal. All Goalore members can create alliances. Alliances can be public alliances or private alliances.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Public Alliances</strong>: These alliances are open to anyone to view and join the alliance.&nbsp;<em>Examples of public alliances:</em>&nbsp;<em>Fundraise for a new school program, Advocate for government policy (climate, safety, freedom, etc.)</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Private Alliances:&nbsp;</strong>These alliances are only visible to the alliance members. Members can join the alliance only with an invitation.&nbsp;<em>Examples of private alliances:</em>&nbsp;<em>Lose weight</em>,&nbsp;<em>start a new business, organizing a family reunion, planning a family event, etc.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The following features help to manage the alliance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Alliance Members</strong>: Members can be Admins or non-admin members. Admins can invite other Goalore members who are connected to them to join the alliance. For public alliances, anyone can join the alliance without invitation. Typically, members who are in a similar goal journey or members interested in the community are good candidates for joining the alliance. They can be regular members within the alliance or admin members of the alliance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Alliance Goals:</strong>&nbsp;Any member of the alliance can link a goal that is relevant to the alliance objectives. These could be public goals or private goals. Admins can remove a linked goal in addition to linking a goal. Everyone within the alliance can view and follow the alliance goals. With this feature, we can break a large alliance goal/objective into smaller goals that each alliance member can own and achieve.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Alliance Actions:&nbsp;</strong>With this feature, we could track specific actions to manage the alliance. This could be small tasks such as getting an opinion on a topic, asking the admin to invite another friend or asking if someone can start an alliance goal to address a gap.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Join Goalore and start using the alliance feature to achieve your goals by collaborating with other like-minded Goalore members.</p>\n<!-- /wp:paragraph -->','Alliance','','publish','open','open','','alliance','','','2020-01-29 01:01:58','2020-01-29 01:01:58','',0,'https://staginggoalore.wpengine.com/?p=49',0,'post','',0),(50,1,'2019-11-12 10:45:59','2019-11-12 10:45:59','a:10:{s:4:\"type\";s:8:\"repeater\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:9:\"collapsed\";s:0:\"\";s:3:\"min\";s:0:\"\";s:3:\"max\";s:0:\"\";s:6:\"layout\";s:5:\"table\";s:12:\"button_label\";s:0:\"\";}','How it Works','how_it_works','publish','closed','closed','','field_5dca8c8982988','','','2019-11-12 10:46:50','2019-11-12 10:46:50','',15,'https://staginggoalore.wpengine.com/?post_type=acf-f