wp:paragraph -->\n<p>We are constantly looking for other ways to use “Good Deed Points”. &nbsp;We hope you will find more opportunities to do good deeds at Goalore. Please join Goalore and let’s help each other to achieve our goals!</p>\n<!-- /wp:paragraph -->','Good Deeds','','inherit','closed','closed','','45-revision-v1','','','2019-11-19 12:44:08','2019-11-19 12:44:08','',45,'https://staginggoalore.wpengine.com/45-revision-v1/',0,'revision','',0),(131,1,'2019-11-19 12:44:28','2019-11-19 12:44:28','<!-- wp:paragraph -->\n<p>Our goals fall into two broad categories – Individually achievable goals and Commonly achievable goals. Within the Goalore community, you can create and manage individually achievable goals and commonly achievable goals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Individually achievable goals:</strong>&nbsp; These goals can be achieved with our individual contribution with little to no help from others. Other characteristics of these goals are they may be like a goal you have achieved previously, or the goal is in an area you have a lot of experience and expertise. &nbsp;Within Goalore, you can manage these goals using the “Goals” feature. If you make your goal public, other Goalore members can follow your goal, track your milestones, challenges, and provide their point of views to support your goal journey.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Examples: Lose weight, Train for a marathon, learn a new language, learn to cook, hike in the alps, buy a house, etc.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Commonly achievable goals:</strong>&nbsp;These goals are typically large goals that require significant support from your support network or the larger community. These goals may be community goals that will benefit everyone within the community. They could also be ambitious individual goals in a new area that you are trying to learn in your journey towards achieving the goal. Within Goalore, you can manage these goals in two ways. Manage them like Individual goals using the “Goals” feature. Another way to manage them is to use the powerful “Alliance” feature.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Examples: Fundraise for a new school program, Advocate for government policy (climate, safety, freedom, etc.), start a new business, organizing a family reunion, planning a family event, etc.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Goalore Alliances:</strong>&nbsp;&nbsp;If you have a large individual or community goal to achieve, the Alliance feature could be an attractive and effective way to achieve the goal. All Goalore members can create alliances. &nbsp;You start by defining the objectives of the alliance – by clearly articulating what you are trying to achieve. Once you have done that, you can then invite other members to join the alliance, attach goals that aid the Alliance objectives, and track actions in support of the Alliance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Alliance Members: You can invite other Goalore members to join the Alliance. Typically, members who are in a similar goal journey or members interested in the community are good candidates for joining the Alliance. They can be regular members within the Alliance or admin members of the Alliance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Alliance Goals: Any member of the Alliance can attach a goal that is relevant to the Alliance objectives. These could be public goals or private goals that is not visible to anyone outside the Alliance. Everyone within the Alliance can view the alliance goals – the milestones, challenges, and help each other with point of views. With this feature, you can break a large Alliance objective into smaller goals that each Alliance member can own and achieve. This enables the Alliance members to work together to achieve the larger objective.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Alliance Actions: With this feature, you could track specific actions to manage the Alliance. This could be small tasks such as getting opinion on a topic or inviting someone or asking if someone can start an alliance goal to address a gap.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>&nbsp;So, what are your waiting for? Join Goalore and start using the Alliance feature to achieve your larger goals by collaborating with other like minded Goalore members.</p>\n<!-- /wp:paragraph -->','Alliance','','inherit','closed','closed','','49-revision-v1','','','2019-11-19 12:44:28','2019-11-19 12:44:28','',49,'https://staginggoalore.wpengine.com/49-revision-v1/',0,'revision','',0),(132,1,'2019-11-19 12:44:38','2019-11-19 12:44:38','<!-- wp:paragraph -->\n<p>5 Steps to a&nbsp;<strong>SMART</strong>&nbsp;personal goal:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Goals are the cornerstones to business growth and opportunity but when it’s time to look at our own personal growth and opportunity we often fail to setup personal goals. Almost all workers are familiar with monthly, quarterly or annual goals set by them or for them by their employer. It is diligently tracked, reviewed and one’s success is measured at the end of the year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Are we able to follow the same concept albeit in a simpler fashion when it comes to our personal goals?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your personal goal is a vision to be charted and realized by you. Goals can help bring clarity and purpose. It doesn’t cost you money to set your goal, just your time. Question is : are we willing to invest the time to plan the steps to achieving our personal goal and reap the rewards?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We all have heard of SMART goals in business context – Specific, Measurable, Achievable, Relevant, Timely Goals. Here is my take on the 5 steps to a S.M.A.R.T personal goal.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>S</strong>et a specific stretch goal that’s relevant</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>What do you want to achieve? Why this goal? When? Where? Who are my partners? Is this goal relevant for me? Keep in mind that a stretch goal is a positive influencer whereas an irrelevant goal will have the opposite effect.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>M</strong>ark your Milestones</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Questions you will be asking once you have your goal determined – How do I get there? What is the path I am taking? What are the milestones along the way?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Milestones are points along the journey to achieving your goal. Defining the milestones along the way will help you track progress and will make your goal clearer and easier to reach. Milestones help you ‘keep it real’ by giving you a clear view of progress.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>A</strong>ssess your Challenges</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Assess the challenges for your goal - money, training, time, support, etc. You need to weigh the time, effort, resources it takes to achieve your goal against the limitations you have and the benefits of achieving your goal. Always remember, this is your goal and you have a responsibility to set yourself up for success. So be honest to self.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>R</strong>each out</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>If you have a clear, achievable goal that is relevant to you and your milestones are defined its almost time to kick start your journey.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At this stage take a step back to think - Are there people who have achieved this goal before? Who will be my support system along this path? Who can I reach out to get input? If someone out there has already done what you are trying to do why not ask for their input? Reach out to others and talk about your goal. Garner their support and feedback.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>T</strong>ravel</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Now that you have a clear, achievable goal that is relevant to you, your milestones are defined and support gathered, it’s time to start your journey.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Celebrate the successful completion of milestones and overcoming challenges on your way to your goal.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once you achieve your goal take a moment to enjoy your success and thank your supporters in this journey.</p>\n<!-- /wp:paragraph -->','Setting a Goal','','inherit','closed','closed','','58-revision-v1','','','2019-11-19 12:44:38','2019-11-19 12:44:38','',58,'https://staginggoalore.wpengine.com/58-revision-v1/',0,'revision','',0),(133,1,'2019-11-19 12:44:50','2019-11-19 12:44:50','<!-- wp:paragraph -->\n<p>If you are like most of humanity, you are probably chasing a set of self, family, friends, or community related goals. Your goal may look similar to a goal that your friend or an acquaintance is trying to achieve, but everyone’s situation is different. Your personality, location, education, family, friends, community, health, finance, gender, age, aspirations, struggles, and life experience make you one of a kind in this world.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The journey for achieving a goal is unique for everyone. What could be an easy goal to achieve for someone might be a difficult goal to achieve for you (and vice versa) as your situation could be a lot different.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Goalore is an open and free community that helps individuals to achieve their goals. Every member can track their unique journey in achieving their goals – the milestones and challenges that come along the way. Other members can follow your goals and provide their point of views during your journey - share their experience in overcoming a challenge or provide insight into a milestone you might have not thought of.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, you could keep your goals private or make them public. There are no restrictions to number of goals that you can create. Your goal could be a big goal that helps a lot of people in the community or a small goal focused on your development. If you happen to find other members who may be working to achieve a goal like yours, you could form an alliance with those members and work together in achieving the goal.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our hope is that your unique journey in achieving a goal by working hard, achieving milestones, overcoming challenges, and supported by member point of views will inspire someone else to attain a goal that they thought as out of reach for them. Your encouragement, wisdom, and solutions could be a catalyst for someone else.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are already a Goalore member, we thank you for your membership and support for our community. If you are not a member, we humbly request you to join our community, invite your friends, and join us on many journeys in achieving goals and inspiring others.</p>\n<!-- /wp:paragraph -->','What is Goalore?','','inherit','closed','closed','','61-revision-v1','','','2019-11-19 12:44:50','2019-11-19 12:44:50','',61,'https://staginggoalore.wpengine.com/61-revision-v1/',0,'revision','',0),(134,1,'2019-11-19 13:09:01','2019-11-19 13:09:01','<!-- wp:paragraph -->\n<p>Most do some good deeds regularly – out of love, conscience, affiliation, religion, or other factors. We do this primarily to help others and the community. Good deeds can be in many shapes - money, services, time, advice, or encouragement. The important attribute of a good deed is the positive impact it can make. Often, a small and timely help in the shape of an advice or encouragement has a big impact on someone’s life than a monetary help. Most do not expect anything in return for the good deed other than the knowledge their good deed made a difference in someone’s life – big or small.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Goalore, we want to create a forum for members to help other members achieve their individual or community goals. The help can be a timely point of view, that can be a solution to overcome a challenge; perhaps you are in a similar journey and can provide wisdom to avoid pitfalls; or you are offering encouragement. These good deeds could motivate and bring a big positive impact to individuals and the community at large.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, we track these good deeds as “Good Deed Points”. The main reason we want to track “Good Deed Points” is to help members. If you are helping others, we want others to help you more. When members connected to you or general members are searching for goals, members with highest “Good Deed Points” are ranked higher – making it easier for members to follow your goal and help you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You can earn “Good Deed Points” in the following ways.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>When you join Goalore – we grant you some points as appreciation for your action to join the community.</li><li>Point of Views (POV) – Goal owners can rate your point of views.</li><li>Number of followers for your completed goals. This recognition is for inspiring other members within the Goalore community to follow and support your goal through completion.</li><li>Referring your friends and family to join Goalore to grow/support the community.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>We are constantly looking for other ways to use “Good Deed Points”. &nbsp;We hope you will find more opportunities to do good deeds at Goalore. Please join Goalore and let’s help each other to achieve our goals!</p>\n<!-- /wp:paragraph -->','Good Deeds','','inherit','closed','closed','','45-revision-v1','','','2019-11-19 13:09:01','2019-11-19 13:09:01','',45,'https://staginggoalore.wpengine.com/45-revision-v1/',0,'revision','',0),(135,1,'2019-11-19 13:10:32','2019-11-19 13:10:32','<!-- wp:paragraph -->\n<p>Most do some good deeds regularly – out of love, conscience, affiliation, religion, or other factors. We do this primarily to help others and the community. Good deeds can be in many shapes - money, services, time, advice, or encouragement. The important attribute of a good deed is the positive impact it can make. Often, a small and timely help in the shape of an advice or encouragement has a big impact on someone’s life than a monetary help. Most do not expect anything in return for the good deed other than the knowledge their good deed made a difference in someone’s life – big or small.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Goalore, we want to create a forum for members to help other members achieve their individual or community goals. The help can be a timely point of view, that can be a solution to overcome a challenge; perhaps you are in a similar journey and can provide wisdom to avoid pitfalls; or you are offering encouragement. These good deeds could motivate and bring a big positive impact to individuals and the community at large.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, we track these good deeds as “Good Deed Points”. The main reason we want to track “Good Deed Points” is to help members. If you are helping others, we want others to help you more. When members connected to you or general members are searching for goals, members with highest “Good Deed Points” are 