he Goalore community to follow and support your goal through completion.</li><li>Referring your friends and family to join Goalore to grow/support the community.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>We are constantly looking for other ways to use “Good Deed Points”. &nbsp;We hope you will find more opportunities to do good deeds at Goalore. Please join Goalore and let’s help each other to achieve our goals!</p>\n<!-- /wp:paragraph -->','Good Deeds','','inherit','closed','closed','','45-revision-v1','','','2019-11-23 10:02:44','2019-11-23 10:02:44','',45,'https://staginggoalore.wpengine.com/45-revision-v1/',0,'revision','',0),(220,1,'2019-11-23 11:48:26','2019-11-23 11:48:26','','Home Page','','inherit','closed','closed','','2-revision-v1','','','2019-11-23 11:48:26','2019-11-23 11:48:26','',2,'https://staginggoalore.wpengine.com/2-revision-v1/',0,'revision','',0),(221,1,'2019-11-23 11:49:05','2019-11-23 11:49:05','','Home Page','','inherit','closed','closed','','2-revision-v1','','','2019-11-23 11:49:05','2019-11-23 11:49:05','',2,'https://staginggoalore.wpengine.com/2-revision-v1/',0,'revision','',0),(222,1,'2019-11-23 11:49:24','2019-11-23 11:49:24','','Home Page','','inherit','closed','closed','','2-revision-v1','','','2019-11-23 11:49:24','2019-11-23 11:49:24','',2,'https://staginggoalore.wpengine.com/2-revision-v1/',0,'revision','',0),(227,2,'2020-01-21 06:31:59','2020-01-21 06:31:59','','New Test Goal','','publish','closed','closed','','new-test-goal','','','2020-01-21 06:31:59','2020-01-21 06:31:59','',0,'https://staginggoalore.wpengine.com/goals/new-test-goal/',0,'goals','',6),(229,1,'2019-11-27 07:26:37','2019-11-27 07:26:37','testteest\n','Goals','','inherit','open','closed','','hiw-img-1-2','','','2019-12-31 21:10:36','2019-12-31 21:10:36','',2,'https://goalore01.blob.core.windows.net/goalore-wp/2019/11/hiw-img-1-1.jpg',0,'attachment','image/jpeg',0),(231,1,'2019-11-27 09:27:56','2019-11-27 09:27:56','a:10:{s:4:\"type\";s:8:\"repeater